import React, { Component } from 'react'

class NavBar extends Component {
    render() {
        return (
            <div>
                <nav classN="navbar navbar-light bg-light">
                    <a class="navbar-brand" href="#">Navbar</a>
                </nav>
            </div>
        )
    }
}

export default NavBar;
